import React from 'react';
import './header.css'; 
import main from './main.png';

function HomepageHeader(props) {
    return (
        <div>
            <div className="header-container-2">
                <img src={main} alt="company logo" className="" />
            </div>
        </div>
    );
}

export default HomepageHeader;
